import React, { Component } from "react";
import Slider from "react-slick";
import BasicExample from "./sliderCart";
import '../UI/slider.css'



export default class MultipleItems extends Component {
  
  con
  
  render() {
    var settings = {
      className: "center",
      centerMode: true,
      centerPadding: "100px",
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 3,
      initialSlide: 0,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 2,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
    return (
      <div>
        <h2> Responsive </h2>
        <Slider {...settings}>
          <div>
            <BasicExample></BasicExample>
          </div>
          <div>
          <BasicExample></BasicExample>
          </div>
          <div>
          <BasicExample></BasicExample>          </div>
          <div>
          <BasicExample></BasicExample>          </div>
          <div>
          <BasicExample></BasicExample>          </div>
          <div>
          <BasicExample></BasicExample>          </div>
          <div>
          <BasicExample></BasicExample>          </div>
          <div>
          <BasicExample></BasicExample>          </div>
        </Slider>
      </div>
    );
  }
}
